import React from "react";
import CaseStudyQuickshow from "./CaseStudyQuickshow";
import { Link } from "react-router-dom";
import "../../stylesheets/case-studies.css";
import "../../stylesheets/quickshow.css";

const CaseStudies = () => {
  return (
    <div id="case-studies-wrapper">
      <div>
        <p>Case Studies</p>
      </div>
      <section>
        <ul>
          <Link to="/case-studies/ripcamp">
            <li className="quickshow-item rc-bg">
              <CaseStudyQuickshow name="RipCamp" desc="Full-stack, Responsive UI" />
            </li>
          </Link>
          <Link to="/case-studies/canopy">
            <li className="quickshow-item ct-bg">
              <CaseStudyQuickshow name="Tax Prep" desc="Canopy, Inc. QA"/>
            </li>
          </Link>
          <Link to="/case-studies/fishhook">
            <li className="quickshow-item fh-bg">
              <CaseStudyQuickshow name="Fishhook" desc="Full-stack, Relational DB"/>
            </li>
          </Link>
          <Link to="/case-studies/ampcamp">
            <li className="quickshow-item ac-bg">
              <CaseStudyQuickshow name="AmpCamp" desc="Full-stack, "/>
            </li>
          </Link>
        </ul>
      </section>
    </div>
  );
};

export default CaseStudies;
